import styled from "styled-components";
import CreateIcon from "@mui/icons-material/Create";

//styling our component
const Wrapper = styled.div`
  display: grid;
  grid-template-columns: 250px auto;
`;

export default function ComposeButton() {
  return (
    <Wrapper>
      <CreateIcon />
      <p>Compose</p>
    </Wrapper>
  );
}
